import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

import "../style/home-view.css";

const Home = () => {
  return (
    <Container>
      <Row>
        <Col sm={12} md={6} className="home-banner banner-image">
          1 of 2
        </Col>
        <Col sm={12} md={4} className="home-banner banner-header">
          2 of 2
        </Col>
      </Row>
    </Container>
  );
};

export default Home;
